    false,nt"url": null,nt"notes": "Conductivity Temperature and Depth (CTD)
    measurements were collected aboard the R/V Brooks McCall Cruise 01 to determine
    physical oceanographic parameters of the water column, and in some cases used to
    help guide sample collection as part of the Deepwater Horizon oil spill sampling
    effort. Temperature, conductivity/salinity, and depth data were collected onboard
    the Brooks McCall, Cruise 01. The final product is a series of NetCDF files containing
    every CTD cast that has been processed and quality checked.",nt"owner_org":
